page_data_script:
if frappe.session.user=="Guest":
    erp = frappe.get_doc('Erp Settings')
    erp.redirect_login("/account")

text = frappe.form_dict.search or ""
erp = frappe.get_doc('Erp Settings')
list_info = erp.search_products(text)
frappe.log_error("context",list_info)
items = list_info.get("product_results")

if items:
        erp = frappe.get_doc('Erp Settings')
        for x in items:
            if not x.website_item_thumbnail:
                x.website_item_thumbnail = "/files/gf_no_image.png"
            price_info = erp.get_item_price(x.item_code)

            if price_info and price_info.get("product_info"):
                x.in_stock = price_info.get("product_info").get("in_stock")
                if price_info.get("product_info").get("price"):
                    x.formatted_price = price_info.get("product_info").get("price").get("formatted_price")
data.items = items

data.route = frappe.db.get_all("Item Group",filters={"route":frappe.form_dict.category or "meats"})
erp = frappe.get_doc('Erp Settings')
attributes = frappe.form_dict.get("attributes") if frappe.form_dict.get("attributes") else ""
category = frappe.form_dict.category if frappe.form_dict.category else ""
item_group_name = data.route[0]['name'] if (data.route[0] and data.route[0]['name']) else ""
data.list_info = erp.get_item_list(item_group_name,attributes )

if data.list_info.get("items"):
    for x in data.list_info.get("items"):
        if not x.website_image:
            x.website_image = "/files/gf_no_image.png"

frappe.log_error("items_Cat",data.list_info)
# cart items8007
if(data.user_info and len(data.user_info) != 0):
    data.quotation = frappe.db.get_all("Quotation",fields=["name","total_qty"], filters={"party_name":data.user_info[0]["name"],"order_type":"Shopping Cart","status":"draft"})
    if data.quotation and len(data.quotation) > 0:
        data.update({"total_qty":round(data.quotation[0]["total_qty"])}) 
        cart_items = frappe.get_doc("Quotation", data.quotation[0]["name"])
        if len(cart_items.get("items")) > 0 and len(data.list_info.get("items")) > 0:
            for item in data.list_info.get("items"):
                item["qty"] = 0
                for cart_item in cart_items.get("items"):
                    if(item.get("item_code") == cart_item.get("item_code")):
                        item["qty"] = cart_item.qty
data.items = data.list_info.get("items") 
web_item = frappe.get_doc('Item Group', {"route":frappe.form_dict.category or "furnishing-decor"})
context = web_item
web_item.get_context(context)
data.context = context
if context.attribute_filters and len( context.attribute_filters):
    for filter in context.attribute_filters:
        all_attributes = []
        if(filter.item_attribute_values and len(filter.item_attribute_values)>0):
            for attribute in filter.item_attribute_values:
                attr={}
                attr["value"] = attribute
                all_attributes.append(attr)
            filter["item_attribute_values"] = all_attributes   
data.attribute_filters = context.attribute_filters  
# Mobile category nav
if frappe.form_dict.category:
    item_group_info = frappe.get_doc('Item Group',{"route":frappe.form_dict.category})
    frappe.log_error("item_group_info.get(parent_item_group)",item_group_info.get('parent_item_group'))
    if item_group_info and item_group_info.get('parent_item_group') != 'All Item Groups':
        data.first_parent_categories = frappe.get_all('Item Group',fields=['name','route','item_group_name'],filters={'parent_item_group':item_group_info.get('parent_item_group')})
        # frappe.log_error("first_parent_categories",first_parent_categories)
        item_group_info_parent = frappe.get_doc('Item Group',{"name":item_group_info.get('parent_item_group')})
        if item_group_info_parent.get('parent_item_group') != 'All Item Groups':
            data.second_parent_categories = frappe.get_all('Item Group',fields=['name','route','item_group_name'],filters={'parent_item_group':item_group_info_parent.get('parent_item_group')})
            # frappe.log_error("second_parent_categories",second_parent_categories)
